PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE AREA (
    id  TEXT NOT NULL PRIMARY KEY,
    txt TEXT NOT NULL
);
CREATE TABLE CENTRO (
    id          INTEGER NOT NULL PRIMARY KEY,
    area        TEXT REFERENCES AREA(id),
    tipo        TEXT NOT NULL,
    nombre      TEXT NOT NULL,
    domicilio   TEXT,
    municipio   TEXT,
    distrito    TEXT,
    cp          INTEGER,
    telefono    TEXT,
    email       TEXT,
    titularidad TEXT NOT NULL REFERENCES TITULARIDAD(id), jornada TEXT REFERENCES JORNADA(id),
    CONSTRAINT fk_centro_tipo
        FOREIGN KEY (tipo)
        REFERENCES TIPO(id)
        ON DELETE CASCADE
);
CREATE TABLE ETAPA (
    id  TEXT NOT NULL PRIMARY KEY,
    txt TEXT NOT NULL
);
CREATE TABLE ETAPA_CENTRO (
    centro INTEGER NOT NULL,
    etapa  TEXT NOT NULL,
    PRIMARY KEY (centro, etapa),
    CONSTRAINT fk_etapa_centro_centro
        FOREIGN KEY (centro)
        REFERENCES CENTRO(id)
        ON DELETE CASCADE,
    CONSTRAINT fk_etapa_centro_etapa
        FOREIGN KEY (etapa)
        REFERENCES ETAPA(id)
        ON DELETE CASCADE
);
CREATE TABLE JORNADA (
    id  TEXT NOT NULL PRIMARY KEY,
    txt TEXT NOT NULL
);
CREATE TABLE QUERY (
    id  TEXT NOT NULL PRIMARY KEY,
    txt TEXT
);
CREATE TABLE QUERY_CENTRO (
    centro INTEGER NOT NULL,
    query  TEXT NOT NULL,
    PRIMARY KEY (centro, query),
    CONSTRAINT fk_query_centro_centro
        FOREIGN KEY (centro)
        REFERENCES CENTRO(id)
        ON DELETE CASCADE,
    CONSTRAINT fk_query_centro_query
        FOREIGN KEY (query)
        REFERENCES QUERY(id)
        ON DELETE CASCADE
);
CREATE TABLE TIPO (
    id  TEXT NOT NULL PRIMARY KEY,
    txt TEXT NOT NULL,
    abr TEXT NOT NULL UNIQUE
);
CREATE TABLE TITULARIDAD (
    id  TEXT NOT NULL PRIMARY KEY,
    txt TEXT NOT NULL
);
COMMIT;
VACUUM;
PRAGMA foreign_keys=ON;
pragma integrity_check;
pragma foreign_key_check;
